import { useRouter } from 'next/router';
import { useDispatch } from "react-redux";
import { getPostsById } from "../../../src/redux/actions/actions"

export default () => {
    const dispatch = useDispatch();
    const router = useRouter();
    const { postId } = router.query;

    React.useEffect(() => {
        getPostsById(postId)
        
    }, [postId]);
    return (
        <h2>Hello world</h2>
    )
}
